</mark>
 is an immunosuppressive drug that is widely used to prevent organ transplant rejection . Known intracellular ligands for cyclosporine include the cyclophilins , a large family of phylogenetically conserved proteins that potentially regulate protein folding in cells . Immunosuppression by cyclosporine is thought to result from the formation of a drug-cyclophilin complex that binds to and inhibits calcineurin , a serine / threonine phosphatase that is activated by TCR engagement . Amino acids within the cyclophilins that are critical for binding to cyclosporine have been identified . Most of these residues are highly conserved within the 15 mammalian cyclophilins , suggesting that many are potential targets for the drug . We examined the effects of cyclosporine on immune cells and mice lacking Ppia , the gene encoding the prototypical cyclophilin protein cyclophilin A . TCR-induced proliferation and signal transduction by Ppia ( - / - )

</mark>
 ( + ) T cells were resistant to cyclosporine , an effect that was attributable to diminished calcineurin inhibition . Immunosuppressive doses of cyclosporine failed to block the responses of Ppia ( - / - ) mice to allogeneic challenge . Rag 2 ( - / - ) mice reconstituted with Ppia ( - / - ) splenocytes were also cyclosporine resistant , indicating that this property is intrinsic to Ppia ( - / - ) immune cells . Thus , among multiple potential ligands , CypA is the primary mediator of immunosuppression by cyclosporine .</div>

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Blocking cannabinoid

 receptors for the treatment of nicotine dependence : insights from pre-clinical and clinical studies . Tobacco use is one of the leading preventable causes of death in developed countries . Since existing medications are only partially effective in treating tobacco smokers , there is a great need for improved medications for smoking cessation . It has been recently proposed that cannabinoid CB ( 1 ) receptor antagonists represent a new class of therapeutic agents for drug dependence , and notably , nicotine dependence . Here , we will review current evidence supporting the use of this class of drugs for smoking cessation treatment . Pre-clinical studies indicate that nicotine exposure produces changes in endocannabinoid content in the brain . In experimental animals , N-piperidinyl - 5 - ( 4 - chlorophenyl ) - 1 - ( 2,4- dichlorophenyl ) - DB01213 - 3 - carboxamide ( rimonabant , SR141716 ) and N - ( piperidin - 1 - yl ) - 5 - ( 4 - iodophenyl ) - 1 - ( 2,4- dichlorophenyl ) - 4 - methyl - 1H - pyrazole - 3 - carboxamide ( AM251 ) , two cannabinoid CB ( 1 ) receptor antagonists , block nicotine self-administration behavior , an effect that may be related to the blockade of the dopamine-releasing effects of nicotine in the brain . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 also seems efficacious in decreasing the influence of nicotine-associated stimuli over behavior , suggesting that it may act on two distinct neuronal pathways , those implicated in drug-taking behavior and those involved in relapse phenomena . The utility of rimonabant has been evaluated in several clinical trials . It seems that rimonabant is an efficacious treatment for smoking cessation , although its efficacy does not exceed that of nicotine-replacement therapy and its use may be limited by emotional side effects ( nausea , anxiety and depression , mostly ) . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 also appears to decrease relapse rates in smokers . These findings indicate significant , but limited , utility of rimonabant for smoking cessation .</div>
